import { useLocation, Link } from 'react-router-dom';
import axios from 'axios';

function Gamepage(props) {
    return(
        <body style={{backgroundColor: 'grey', height: '100vh', width: '100vw', top: '10vh', position: 'absolute'}}>
            {console.log(props.location.state)}
            <div style={{position: 'absolute', transform: 'translate(-50%)', left: '50%'}}>
                <div style={{position: 'absolute', color: 'white', left: '1%'}}>Bob</div>
                <Board />
                <div style={{color: 'white', position: 'absolute', top: '100%'}}>{props.location.state[0].name}</div>
                <div style={{color: 'white', position: 'absolute', top: '102%'}}>{props.location.state[0].elo}</div>
            </div>
            <br/>
        </body>
    );
}

export default Gamepage;
